			shellScript = "#!/bin/bash\nset -euo pipefail\n\n# --- Ensure cargo is available on PATH -------------------------------------\nif [ -d \"$HOME/.cargo/bin\" ]; then\n  export PATH=\"$HOME/.cargo/bin:$PATH\"\nfi\n\n# --- Configuration ---------------------------------------------------------\nRUST_CRATE_DIR=\"$SRCROOT/../../../crates/nesium-flutter\"\n\nARM_TARGET=\"aarch64-apple-darwin\"\nX86_TARGET=\"x86_64-apple-darwin\"\n\nFRAMEWORKS_DIR=\"$SRCROOT/Frameworks\"\nOUTPUT_LIB_NAME=\"libnesium_flutter.dylib\"\n\n# --- Sanity checks ---------------------------------------------------------\nif [ ! -d \"$RUST_CRATE_DIR\" ]; then\n  echo \"[Rust] ERROR: Crate directory not found: $RUST_CRATE_DIR\" >&2\n  exit 1\nfi\n\nif ! command -v cargo >/dev/null 2>&1; then\n  echo \"[Rust] ERROR: 'cargo' not found in PATH. Please install Rust toolchain or update PATH.\" >&2\n  echo \"[Rust] Current PATH: $PATH\" >&2\n  exit 1\nfi\n\n# --- Determine build mode --------------------------------------------------\n# Requirement:\n#   - CONFIGURATION=Release        -> use custom profile: release-dist\n#   - CONFIGURATION!=Release       -> use standard release (even Debug/Profile/etc)\n#\n# Arch policy (unchanged from your original):\n#   - Debug: arm64 only (faster local iteration)\n#   - Others: universal (arm64 + x86_64)\nif [ \"${CONFIGURATION:-}\" = \"Debug\" ]; then\n  UNIVERSAL=0\n  TARGETS=(\"$ARM_TARGET\")\nelse\n  UNIVERSAL=1\n  TARGETS=(\"$ARM_TARGET\" \"$X86_TARGET\")\nfi\n\n# Cargo profile selection\nCARGO_ARGS=()\nPROFILE_DIR=\"\"\nBUILD_LABEL=\"\"\n\nif [ \"${CONFIGURATION:-}\" = \"Release\" ]; then\n  CARGO_ARGS+=(--profile release-dist)\n  PROFILE_DIR=\"release-dist\"\n  BUILD_LABEL=\"release-dist\"\nelse\n  CARGO_ARGS+=(--release)\n  PROFILE_DIR=\"release\"\n  BUILD_LABEL=\"release\"\nfi\n\n# --- Build the Rust dynamic library ----------------------------------------\nWORKSPACE_ROOT=\"$RUST_CRATE_DIR/../..\"\ncd \"$WORKSPACE_ROOT\"\n\nfor TARGET in \"${TARGETS[@]}\"; do\n  echo \"[Rust] Building nesium-flutter ($BUILD_LABEL) for $TARGET (CONFIGURATION=${CONFIGURATION:-<unset>})\"\n  cargo build --target \"$TARGET\" \"${CARGO_ARGS[@]}\" -p nesium-flutter\ndone\n\nmkdir -p \"$FRAMEWORKS_DIR\"\nDST_LIB=\"$FRAMEWORKS_DIR/$OUTPUT_LIB_NAME\"\n\nif [ \"$UNIVERSAL\" -eq 1 ]; then\n  ARM_LIB=\"target/$ARM_TARGET/$PROFILE_DIR/$OUTPUT_LIB_NAME\"\n  X86_LIB=\"target/$X86_TARGET/$PROFILE_DIR/$OUTPUT_LIB_NAME\"\n\n  if [ ! -f \"$ARM_LIB\" ] || [ ! -f \"$X86_LIB\" ]; then\n    echo \"[Rust] ERROR: Built libraries not found for all targets.\" >&2\n    echo \"[Rust] Expected:\" >&2\n    echo \"  $ARM_LIB\" >&2\n    echo \"  $X86_LIB\" >&2\n    echo \"[Rust] Available files in target/$ARM_TARGET/$PROFILE_DIR:\" >&2\n    ls \"target/$ARM_TARGET/$PROFILE_DIR\" >&2 || true\n    echo \"[Rust] Available files in target/$X86_TARGET/$PROFILE_DIR:\" >&2\n    ls \"target/$X86_TARGET/$PROFILE_DIR\" >&2 || true\n    exit 1\n  fi\n\n  echo \"[Rust] Creating universal dynamic library: $DST_LIB\"\n  lipo -create \"$ARM_LIB\" \"$X86_LIB\" -output \"$DST_LIB\"\n  echo \"[Rust] Done (universal dylib).\"\nelse\n  ARM_LIB=\"target/$ARM_TARGET/$PROFILE_DIR/$OUTPUT_LIB_NAME\"\n\n  if [ ! -f \"$ARM_LIB\" ]; then\n    echo \"[Rust] ERROR: Built library not found: $ARM_LIB\" >&2\n    echo \"[Rust] Available files in target/$ARM_TARGET/$PROFILE_DIR:\" >&2\n    ls \"target/$ARM_TARGET/$PROFILE_DIR\" >&2 || true\n    exit 1\n  fi\n\n  cp \"$ARM_LIB\" \"$DST_LIB\"\n  echo \"[Rust] Copied $ARM_LIB -> $DST_LIB (Debug config, arm64 only; built with $BUILD_LABEL)\"\nfi\n";
